hooks.body:
var body = {};
body['callback'] = request_vendor_body_map;
var request_vendor_body = {};
done({
    "request_vendor_body": body
});

var webhookId = configuration['webhook.callback.id'];
if (webhookId === null || webhookId === undefined) {
    done({
        "continue": false
    });
} else {
  done({});
}

if (!response_iserror) {
    var memberships = {};
    var business_name = configuration['business.name'];
    var account_id = '';
    let newMap = {};
    var me = response_body;
    var business_memberships = me.response.business_memberships;

    business_memberships.forEach(memebership => {
        let thisAccount = {};
        var name = memebership.business.name;
        if (name === business_name) {
            newMap['accountId'] = memebership.business.account_id;
            newMap['business.id'] = memebership.business.id;
        }
        thisAccount.account_id = memebership.business.account_id;
        thisAccount.business_id = memebership.business.id;

        /*
        This will be useful when a user wants to fetch data for his/her other business account in freshbooks 
        Here,   'name' is the Business Name, 
                'account_id' is the Business Account ID
                'business_id' is the Business ID
        */
        memberships[name] = thisAccount;
    });
    newMap['memberships'] = JSON.stringify(memberships);
    if (newMap['accountId']) {
        done({
            "configuration": newMap
        });
    } else {
        done({
            "response_body": { error: `Provided business name is invalid, ${business_name} does not exist` },
            "response_body_raw": `Provided business name is invalid, ${business_name} does not exist`,
            "response_status_code": 400
        });
    }
}
done();

// As per Freshbooks CA, we shouldn't sent the `Content-Type` header
var headers = request_vendor_headers;
headers['Content-Type'] = null;
done({
  "request_vendor_headers": headers
})

//As per Freshbooks CA, we shouldn't sent the `Content-Type` header
var headers = request_vendor_headers;
headers['Content-Type'] = null;
done({
  "request_vendor_headers": headers
})

//As per Freshbooks CA, we shouldn't sent the `Content-Type` header
var headers = request_vendor_headers;
headers['Content-Type'] = null;
done({
  "request_vendor_headers": headers
})

//As per Freshbooks CA, we shouldn't sent the `Content-Type` header for this guy
var headers = request_vendor_headers;
headers['Content-Type'] = null;
done({
  "request_vendor_headers": headers
})

var path = request_vendor_path;	//This is vendor url mapped at resource
var vendorUrl = request_vendor_url; //This includes base URL also.  So that I can replace accountID here
/**
 * If the user wants to access an account other than default account which they have given over provisioning,
 he/she should pass the required 'business-name' header.  So, that we can fetch the businessID and accountId
 for the given business-name from configs.   @refer PROVISION_AUTH_VALIDATION resource for other details*/
if (request_headers && request_headers['business-name'] && configuration['memberships']) {
    var memberships = JSON.parse(configuration['memberships']);
    var defaultAccountId = configuration['accountId'];
    let defaultBusinessId = configuration['business.id'];
    var businessName = request_headers['business-name'];

    if (memberships[businessName]) {
        //Get the account_id and business_id from memberships and then replace
        let accountId = memberships[businessName]['account_id'];

        //This is useful for /employees and /projects
        let businessId = memberships[businessName]['business_id'];;

        vendorUrl = vendorUrl.replace(defaultBusinessId, businessId);
        vendorUrl = vendorUrl.replace(defaultAccountId, accountId);
    } else {
        done({
            "response_body": { error: `Provided business name is invalid, ${businessName} does not exist` },
            "response_body_raw": `Provided business name is invalid, ${businessName} does not exist`,
            "response_status_code": 400,
            "continue": false
        });
    }
}

var expressionQuery = request_expression;

// if we don't have a WHERE query, then return GET List path, don't do anything
if (!expressionQuery || path.indexOf('search') > -1) {
    done({
        "request_vendor_path": vendorUrl
    });
}
//If we have query params we have to massage it like if query is '?name=chinna' then 
//should do like '?search[name]=chinna'
var filterString = '?';
for (var i = 0; i < expressionQuery.length; i++) {
    var values = [];
    var key = expressionQuery[i].attribute;
    var operator = expressionQuery[i].operator;
    var value = expressionQuery[i].value;

    if (value.includes(',')) {
        values = value.split(',');
        values.forEach(function (val, idx, array) {
            filterString += 'search[' + key + ']' + operator + val.trim();
            filterString += idx === array.length - 1 ? '' : '&';
        });
    }
    else {
        filterString += 'search[' + key + ']' + operator + value.trim();
    }
    filterString += expressionQuery.length - 1 === i ? '' : '&';
}

vendorUrl += encodeURI(filterString);

done({
    "request_vendor_path": vendorUrl
});
